import React, { Component } from 'react'
import './flag.css'

export class Flag extends Component {
    constructor(props) {
        super(props)
        this.state = {
            flag: []
        }
    }
    render() {
        return (
            <div>
                <img alt="flag" src="" />
            </div>
        )
    }
}

export default Flag
